DROP TABLE IF EXISTS `Calculation4K`;
CREATE TABLE `Calculation4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Structure4K`;
CREATE TABLE `Structure4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Composition4K`;
CREATE TABLE `Composition4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `BandGap4K`;
CREATE TABLE `BandGap4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `band_gap` float NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `SpaceGroup4K`;
CREATE TABLE `SpaceGroup4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `spacegroup` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `FormationEnergy4K`;
CREATE TABLE `FormationEnergy4K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `delta_e` float NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;









